postcontent:
Manufactured by "Vyatskie Polyany" (MOLOT).  Manufactured in 2000, Robinson Arms imported these for only 3 years, from 1999 through 2001.  Extremely difficult to find and rare in this condition.  Current MOLOT VEPR's just do not compare to the early Robinson Arms imports; it is said that these early Robinson Arms MOLOT VEPR II's are the finest AK's ever brought into the States.  This rifle is in absolute pristine condition.  The pics tell the story, and I have more available if need be.  I have fired less than 150 rounds through it via 4 trips to the range. Other than that, this rifle has remained cased and in the safe.  With the 20.5" bbl., she is set up to shoot long distance:

> Custom cheek rest; 
> Aluminum handguard from Carolina Shooters Supply;  
> Muzzle break; 
> MagPul forend grip; 
> Low-profile tactical bipod; 
> Hogue grip sleeve; 
> 4x16x44 illuminated Mil-Dot scope mounted on original removable left-sided receiver scope base;
> Four (4) 30-rd. polymer TAPCO magazines, new;
> One (1) 20-rd. polymer TAPCO magazine, new;
> One (1) 30-rd. steel Russian magazine that came with firearm, new.

You will also get the original matching foregrip, same material as the composite buttstock.  This is a gorgeous and accurate rig.  Good luck even finding an early Robinson Arms MOLOT VEPR II, let alone one as nice as this one.  

Price is now at $1,475.00.  I am using this to fund another project.  I'm not interested in trades.  I will ship it FROM my FFL (Private Sector Arms, Olympia, WA) if you are out of state, AFTER a USPS money order is cashed and I have green backs in my hand, or after pay is coordinated through the retail storefront FFL dealer here on my end, your choice.  I will be happy to drive and meet you within reason.

(No this is not a Bushmaster.  They didn't list "MOLOT" so I chose something different in the listing).
